import React from "react";
import SectionTitle from "../../components/SectionTitle";

function About() {
  return (
    <div>
      <SectionTitle title="About" />

      <div className="flex">
        <div className="h-[5vh]">
          <lottie-player
            src="https://assets3.lottiefiles.com/packages/ If20_ftjfyyep.json"
            background="transparent"
            speed="|"
            loop
            controls
            autoplay
          ></lottie-player>
        </div>
      </div>
    </div>
  );
}

export default About;
